import React, { useRef } from "react";
import "./CandleChart.css";
import { organizeRunrates } from "./Functions";
import html2canvas from "html2canvas";
import ReactApexChart from "react-apexcharts";
import runrates from "./MatchesData/runrates2.json";

const CandleChart = () => {
  const chartRef = useRef(null);

  const downloadChart = () => {
    const chartElement = chartRef.current;

    html2canvas(chartElement).then((canvas) => {
      const imageData = canvas.toDataURL("");
      console.log(imageData);
      console.log(
        base64ToArrayBuffer(
          ``
        )
      );
    });
  };

  function base64ToArrayBuffer(base64) {
    var binaryString = atob(base64);
    var bytes = new Uint8Array(binaryString.length);
    for (var i = 0; i < binaryString.length; i++) {
      bytes[i] = binaryString.charCodeAt(i);
    }
    return bytes.buffer;
  }

  const organizedData = organizeRunrates(runrates);

  const state = {
    series: [
      {
        data: organizedData,
      },
    ],
    options: {
      chart: {
        type: "candlestick",
        height: 350,
        zoom: {
          enabled: false,
        },
        background: "#000000",
      },
      title: {
        text: "India Vs Australia",
        align: "left",
        style: {
          color: "#FFFFFF",
        },
      },
      xaxis: {
        type: "",
        axisBorder: {
          show: true,
          color: "#FFFFFF",
        },
        axisTicks: {
          show: true,
          color: "#FFFFFF",
        },
        labels: {
          style: {
            colors: "#FFFFFF",
          },
        },
      },
      yaxis: {
        labels: {
          style: {
            colors: "#FFFFFF",
          },
        },
        tooltip: {
          enabled: false,
        },
      },
      annotations: {
        xaxis: [
          {
            label: {
              borderColor: "#00E396",
              style: {
                fontSize: "12px",
                color: "#fff",
                background: "#00E396",
              },
              orientation: "horizontal",
              offsetY: 7,
              text: "Annotation Test",
            },
          },
        ],
      },
    },
  };

  return (
    <div className="chart">
      <div ref={chartRef}>
        <ReactApexChart
          height={"900px"}
          series={state.series}
          options={state.options}
          type="candlestick"
        />
      </div>
      <button onClick={downloadChart}>Download</button>
    </div>
  );
};

export default CandleChart;
